import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './HomePage.css';

const HomePage = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const navigate = useNavigate();

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <div className="home-container">
      {/* Menu Button */}
      <button className="menu-toggle" onClick={toggleMenu}>
        {menuOpen ? 'Close' : 'Menu'}
      </button>

      {/* Side Menu */}
      <div className={`side-menu ${menuOpen ? 'open' : ''}`}>
        <ul className="menu-items">
          <li onClick={() => navigate('/')}>Home</li>
          <li onClick={() => navigate('/drone')}>Drone Footage</li>
          <li onClick={() => navigate('/images')}>Normal Images</li>
          <li onClick={() => navigate('/about')}>About</li>
        </ul>
      </div>

      {/* Banner Section */}
      <div className="banner">
        <h1>Welcome to DispoEasy</h1>
        <p>Your trusted partner in waste detection and management.</p>
      </div>

      {/* Reviews Section */}
      <div className="reviews-section">
        <h2>What Our Customers Say</h2>
        <div className="reviews">
          <div className="review-card">
            <p>"DispoEasy has revolutionized how we manage waste. Highly recommended!"</p>
            <strong>- John Doe</strong>
          </div>
          <div className="review-card">
            <p>"The drone footage analysis is a game-changer for our business."</p>
            <strong>- Jane Smith</strong>
          </div>
          <div className="review-card">
            <p>"Efficient, reliable, and easy to use. DispoEasy is the best!"</p>
            <strong>- Michael Brown</strong>
          </div>
        </div>
      </div>

      {/* Partners Section */}
      <div className="partners-section">
        <h2>Our Partners</h2>
        <div className="partners">
          <img src="/images/partner1.png" alt="Partner 1" />
          <img src="/images/partner2.png" alt="Partner 2" />
          <img src="/images/partner3.png" alt="Partner 3" />
        </div>
      </div>

      {/* Call to Action */}
      <div className="cta-section">
        <h2>Ready to Get Started?</h2>
        <button onClick={() => navigate('/images')}>Upload Images</button>
        <button onClick={() => navigate('/drone')}>Analyze Drone Footage</button>
      </div>
    </div>
  );
};

export default HomePage;
